import React, { useState } from "react";
import 'react-bulma-components/dist/react-bulma-components.min.css';
import { Navbar, Hero, Container } from 'react-bulma-components';
// import NavBar from "./components/NavBar";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = this.getInicialState();
    }
    state = { active: false }

    getInicialState = () => {
        const inicialState = {
            active: false
        };
        return inicialState;
    };

    toggleActive = () => {
        this.setState({
            active: !this.state.active,
        });
    };
    render() {
        return (
            <>
                <Navbar 
                    transparent={true}
                    active={this.state.active}>
                    <Container>
                        <Navbar.Brand>
                            Andres Cordoba
                            <Navbar.Burger 
                                onClick={this.toggleActive}
                            />
                    </Navbar.Brand>
                        <Navbar.Menu>
                            <Navbar.Container position="end">
                            <Navbar.Item href="#">
                                Skills
                            </Navbar.Item>
                            <Navbar.Item href="#">
                                Projects
                            </Navbar.Item>
                            <Navbar.Item href="#">
                                Contact
                    </Navbar.Item>
                    </Navbar.Container>
                        </Navbar.Menu>
                    </Container>
                </Navbar>
                <Hero fullheight="true" color="white">
                    <Hero.Body>
                        <Container>
                            <Heading>Full stack JS Developer and Web Designer</Heading>
                            <Heading subtitle size={2} ></Heading>
                        </Container>

                    </Hero.Body>
                </Hero>
            </>
        );
    }
}

export default App;
